import './App.css';
import React, { useState } from 'react';
import {
  createBrowserRouter,
  RouterProvider,
} from 'react-router-dom';



const App = () => {

   const router = createBrowserRouter([
    {
      path: '/',
      element: <Home/>,
      children: [],
    },
    {
      path: '/Buy_1',
      element: <Buy_1/>,
      children: [],
    },
    {
      path: '/Cart_edit',
      element: <Cart/>,
      children: [],
    },
    {
      path: '/workspace/:id',
      element: <WorkSpace />,
      children: [],
    },
    {
      path: '/publicpage/:workspaceid',
      element: <PublicPage />,
      children: [],
    },
    {
      path: '/login',
      element: <LoginPage />,
      children: [],
    },
    {
      path: '/frame',
      element: <Iframecode/>,
      children: [],
    },
  ]);

  return <RouterProvider router={router} />;
};

export default App;
